            data['name'] = ele.xpath(".//*[@itemprop='name']/text()").get()
            data['address1'] = ele.xpath(".//*[@itemprop='streetAddress']/text()").get()
            data['city'] = ele.xpath(".//*[@itemprop='addressLocality']/text()").get()
            data['state'] = ele.xpath(".//*[@itemprop='addressRegion']/text()").get()
            data['zipcode'] = zipcode
            data['phone'] = ele.xpath(".//*[@itemprop='telephone']/a/text()").get()
            data['specialties'] = ele.xpath("string(.//*[@class='categoryWrapInner'])").get().strip()
